VIVIANA CANOSA LE ESCRIBIÓ A MILEI EN VIVO y Joni Viale se cayó de traste:

"Es muy fuerte... es una noche histórica" 😂🔥

@JMilei #LaLibertadAvanza #KirchnerismoOLibertad

El mensaje de Milei a Joni Viale tras la fallida emboscada en el Teatro Colón:

"Un grupo de kirchneristas ruidosos que solo muestran lo autoritarios que son. Balance final... un éxito, la salida final un golazo. En la escalinata la gente cantaba MILEI PRESIDENTE"

@JMilei #LaLibertadAvanza #KirchnerismoEsFascismo

Javier Milei, un SEÑOR con todas las letras! Vino al Colón por la puerta principal, se quedó hasta el final pese a algunos abucheos bochornosos. Se fue aplaudido, vitoreado y abrazado. 
MUCHOS te queremos Javi! 
@BatmanDC1976 mi amor y hasta patovica! 

@JMilei MI PRESIDENTE.

